import React from "react";
//import Tabletop from "tabletop";
//import "./styles.css";

const Tabletop = require('tabletop');


function init() {
    Tabletop.init( { key: 'https://docs.google.com/spreadsheets/d/e/2PACX-1vQe412mPe3e2IDJco0b1GpPgsfx3VqNfUH_VGdUziRCSe0zEgnyjLvCxmuFrRVdJWVa14-aZoahdfX2/pubhtml',
                      callback: function(data, tabletop) { 
                        console.log(data)
                      },
                      simpleSheet: true } )
  }
  window.addEventListener('DOMContentLoaded', init)
